import React, { Component } from 'react'
import { Button } from 'reactstrap'
export default class download extends Component {

    styleSheets = {
        mainContainer: {
            width: 100,
            height: 50,
            backgroundColor: "#333",
            position: "absolute",
            left: 850
        }
    }






    render() {

        const { mainContainer } = this.styleSheets
        return (
            <div
                style={mainContainer}>
                <Button
                    color='success'
                ></Button>
            </div>
        )
    }
}
